import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { CreateMasterAdminComponent } from './setup/create-master-admin/create-master-admin.component';
import { initialConfigGuard } from 'src/app/core/config/guards/initial-config.guard';

const routes: Routes = [
  { path: 'initialConfig', component: CreateMasterAdminComponent, canActivate: [initialConfigGuard] },
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class InitialConfigRoutingModule { }
